defs.script:
//
(function () {
"use strict";

if (typeof window === 'undefined') {
	return;
}

var prevSelected;
function select (id) {
	if (prevSelected) {
		prevSelected.classList.remove('selected');
	}
	prevSelected = document.getElementById(id);
	if (prevSelected) {
		prevSelected.classList.add('selected');
	}
}

function onClick (el) {
	var id = el.id;
	if (id && id !== 'container' && window.parent) {
		parent.postMessage(id, '*');
	}
}

function initOnResize () {
	window.removeEventListener('resize', initOnResize);
	initPanzoom();
}

function initPanzoom () {
	panzoom(document.getElementById('container'), {
		realPinch: true,
		onTouch: function () {
			return false;
		}
	});
}

function init () {
	window.addEventListener('message', function (e) {
		select(e.data);
	});
	window.addEventListener('click', function (e) {
		onClick(e.target);
	});
	if (window.panzoom) {
		if (document.getElementById('container').getScreenCTM()) {
			initPanzoom();
		} else { //wait until visible
			window.addEventListener('resize', initOnResize);
		}
	}
}

window.addEventListener('load', init);
})();
//
